import { Box, Typography } from '@mui/material';

const Metrics = ({ mockData }) => {
  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Métricas
      </Typography>
      <Typography variant="body1">
        Página em construção...
      </Typography>
    </Box>
  );
};

export default Metrics;
